def find_nth_prime(n, start):
    """"""

    def is_prime(num):
        """
        Check if a number is prime.

        Args:
            num (int): The number to check.

        Returns:
            bool: True if the number is prime, False otherwise.
        """
        if num <= 1:
            return False
        for i in range(2, int(num ** 0.5) + 1):
            if num % i == 0:
                return False
        return True
    count = 0
    num = start + 1
    while count < n:
        if is_prime(num):
            count += 1
        num += 1
    return num - 1
